import React from 'react'
import ReactDOM from 'react-dom'
import './index.css'
import { MuiThemeProvider } from '@material-ui/core/styles'
import Button from '@material-ui/core/Button'


import TopBar from './components/topBar'

const displayContents = {
    name: "Shed Studio",
    description: "Custom multimedia marketing packages tailored to you",
    avatarUrl: "https://res.cloudinary.com/dwtivbec9/image/upload/v1542456067/jake-walker-1155669-unsplash.jpg",
    email: "shedthestudio@gmail.com",
    social: {
        facebook: "https://facebook.com",
        instagram: "https://instagram.com",
        youtube: "https://youtube.com"
    }

}

class App extends React.Component
{
    constructor(props)
    {
        super(props)
        this.state = displayContents
    }

    render()
    {
        return(
            <MuiThemeProvider theme={theme}>
                <div id="page-wrapper">
                    <TopBar 
                    {...this.state}
                    />
                    <Button color="primary">Testing</Button>
                </div>
           </MuiThemeProvider>
        )
    }
}

ReactDOM.render(<App />,
                document.getElementById('root'))
